function bool ApprovedFromEverybody() 
{

	if this.AgreementStatus.Any(a=> a.Status == "Approved by Administrator"
		&& this.AgreementStatus.Any(b=> b.Status == "Approved by Investor")
		&& this.AgreementStatus.Any(c=> c.Status == "Approved by Supplier")) 
	{ 
	    return true;
	}

	return false;
}

function string Get_CurrentAgreementStatus()
{
	if this.AgreementStatus != null {
	    var firstAgreementStatus = this.AgreementStatus.OrderByDescending(a=> a.DateOccured);
	    if(firstAgreementStatus.Length > 0)
	    {
	        return firstAgreementStatus.First().Status;
	    }
	    else {
	        return "";
	    }
	}
	else {
	    return "";
	}

	//return "";

}

function bool IsInRole(string roleName)
{
	return this.Roles.Any(r => r.Name == roleName);
}

function bool HasPermission(string permission)
{
  bool hasPermissionfromRoles = this.Roles.Any(rr => rr.Permissions.Any(pp => pp.Name == permission));
	return hasPermissionfromRoles || this.Permissions.Any(pp => pp.Name == permission);
}

static function Collection[string] GetDomainFocusOptions(Domain.Investor inv) 
{
	Collection[string] options;

	options.Add("Recurring");
	options.Add("Project-based");
	options.Add("Other");

	if (!options.Contains(inv.DomainFocus) && inv.DomainFocus != null) {
		options.Add(inv.DomainFocus);
	}

	return options;
}

