static function Collection[Domain.ImportedBuyer] FindSupplierBuyers()
{

	string supUsername;

	Collection[Domain.CommercialAgreement] supplierAgreements = Domain.CommercialAgreement.Find(a=> a.Supplier == AppLib.Session.GetCurrentUser());
	Collection[Domain.ImportedBuyer] foundBuyers;

	foreach Domain.CommercialAgreement: supAgreement in supplierAgreements {
	    DebugLib.Logger.WriteWarnLine("buyer: " + supAgreement.ImportedBuyer.Code + "c.a. " + supAgreement.Id.ToString());
		foundBuyers.Add(supAgreement.ImportedBuyer);
	}

	return foundBuyers.Distinct();



}

static function Collection[Domain.Order] FindAgreement()
{
	string userName;

    Collection[Domain.Agreement] agreements = Domain.Agreement.Find(a=> a.Investor == AppLib.Session.GetCurrentUser());
    Collection[Domain.Order] foundOrders;

   	foreach  Domain.Agreement: agr in agreements {
        userName = agr.Supplier.UserName;

        foreach Domain.Order: order in Domain.Order.Find(o => o.Transaction.Supplier.UserName == userName) {
            foundOrders.Add(order);
//          DebugLib.Logger.WriteWarnLine("length foundOrders: " + foundOrders.Length.ToString());
        }
  	} 	
	return foundOrders.Distinct();
}

function void CalculateDataAvailability()
{
	if this.Orders.Length > 0 {
	    this.Supplier.DataAvailability.Orders = true;
	}
}

function decimal Get_TransactionValue()
{
    return this.Invoices.Length > 0 ? this.Invoices.Sum(a=>a.TotalPrice) : 0 ;
}

function decimal Get_FundedAmount()
{
    decimal totalInv=0;
    decimal total=0;
    totalInv = this.Invoices.Sum(a=> a.TotalPrice);
    total = (totalInv * this.CommercialAgreement.Agreement.FundedRate)/100;
    return this.Invoices.Length > 0 ? total : 0 ;
}
